Tommy Wick (Steve Austin) is een koerier voor een rijke lokale misdaadbaas die bekend staat als 'The German' (Dolph Lundgren). 
The German lijdt aan een bloedziekte waardoor hij slecht ter been is en niet lang meer te leven heeft. 
Hij probeert te overleven door organen en bloed te stelen van andere mensen.



